INSERT INTO `english_sentence` VALUES (2,'2020-12-29','Expect the best. Prepare for the worst. Capitalize on what comes.','要抱最大的希望，做最坏的打算，从结果中学习。'),(3,'2020-12-30','Love is just a word until someone comes along and gives it meaning.','爱不过是一个词而已，直到有一个人来到你面前，赋予它意义。'),(4,'2020-12-31','Tomorrow is the first blank page of a 365 page book. Write a good one.','新年之书有365张空白页，明天是第一页。书写美好的明天吧！'),(5,'2021-01-01','For a new year to bring you something new, make a move, like a butterfly tearing its cocoon!','为了迎接，这充满新象的新的一年，像蝴蝶破茧那样行动起来吧！'),(6,'2021-01-02','Love is a promise. Love is a souvenir. Once given, never forgotten. Never let it disappear.','爱是承诺，爱是纪念。一旦赋予，永不被遗忘。莫让爱消失。'),(7,'2021-01-03','Wherever there is a human being, there is an opportunity for a kindness.','哪里有人，哪里就有良善的机会。'),(8,'2021-01-04','It\'s not that I\'m so smart, it\'s just that I stay with problems longer.','不是我聪明，而是我会花更多的时间和问题待在一起。'),(9,'2021-01-05','The future belongs to those who believe in the beauty of their dreams.','未来属于那些相信梦想之美的人。'),(10,'2021-01-06','Winners lose more than losers, because they stay in the game. ','胜利者比失败者输得场次更多，因为他们一直留在赛场上。'),(11,'2021-01-07','The only limit to the height of your achievements is the reach of your dreams and your willingness to work hard for them.','唯一限制你成就高度的，是你梦想的限度，以及为之努力的意愿。'),(12,'2021-01-08','The golden age is before us, not behind us.','黄金时代在我们面前，而不在我们背后。'),(13,'2021-01-09','It never will rain roses. When we want to have more roses we must plant trees.','天上永远不会掉下玫瑰来，如果想要更多的玫瑰，必须自己种植。'),(14,'2021-01-10','Imagination is the voice of daring.','想象力是大胆的体现。'),(15,'2021-01-11','In the end, it\'s not the years in your life that count. It\'s the life in your years.','到头来，你活了多少岁不算什么。重要的是你是如何度过这些岁月的。'),(16,'2021-01-12','No problem can withstand the assault of sustained thinking.','没有问题能经得起不断思考的攻坚。'),(17,'2021-01-13','Put your heart, mind, intellect and soul even to your smallest acts. This is the secret of success.','把你的全身心，灵魂都投入到你所做的最微小的事上。那是成功的秘诀。'),(18,'2021-01-14','Be happy, but never satisfied.','要快乐，但永远不要满足。'),(19,'2021-01-15','You make a life out of what you have, not what you’re missing.','生活依靠的是自己所拥有的，而不是所缺少的东西。'),(20,'2021-01-17','Real magic in relationships means an absence of judgment of others.','良好人际关系的秘诀，在于不对他人做出评判。'),(21,'2021-01-17','Real magic in relationships means an absence of judgment of others.','良好人际关系的秘诀，在于不对他人做出评判。'),(22,'2021-01-18','Everyone wants to be appreciated, so if you appreciate someone, don\'t keep it a secret.','每个人都想被赏识，所以如果你欣赏一个人，别藏在心里。'),(23,'2021-01-19','Activity is the only road to knowledge. ','行动是通往知识的唯一道路。'),(24,'2021-01-20','Action is the foundational key to all success.','行动是所有成功的根本。'),(25,'2021-01-21','Courage is resistance to fear, mastery of fear, not absence of fear.','勇敢并非没有恐惧，而是克服恐惧，战胜恐惧。'),(26,'2021-01-22','Darkness cannot drive out darkness; only light can do that. Hate cannot drive out hate; only love can do that.','黑暗无法驱走黑暗，唯有光明才能做到。仇恨无法驱除仇恨，唯有爱才能做到。'),(27,'2021-01-23','Perseverance is failing nineteen times and succeeding the twentieth.','十九次失败，到第二十次获得成功，这就叫坚持。'),(28,'2021-01-24','You have to believe in yourself. That\'s the secret of success.','你必须相信自己，这是成功的秘诀。'),(29,'2021-01-25','Progress is the activity of today and the assurance of tomorrow.','进步是今天的动力、明日的保证。'),(30,'2021-01-26','There are no secrets to success. It is the result of preparation, hard work, and learning from failure.','成功没有诀窍。成功是筹备，苦干以及在失败中汲取教训的结果。'),(31,'2021-01-27','A day without laughter is a day wasted.','如果一天里没有欢笑，那这一天就被浪费了。'),(32,'2021-01-28','That man is richest whose pleasures are cheapest.','能轻易获得快乐的人最富有。'),(33,'2021-01-29','If winter comes, can spring be far behind?','冬天来了，春天还会远吗？'),(34,'2021-01-30','Positive thinking will let you do everything better than negative thinking will.','比起悲观，乐观会让你把所有事情做得更好。'),(35,'2021-01-31','You\'ll never be alone if you\'ve got a book.','只要手捧书卷，你就永远不会感到孤独。');
/*!40000 ALTER TABLE `english_sentence` ENABLE KEYS */;
