INSERT INTO `kktix_activity` VALUES (1,'國立歷史博物館 X 林業試驗所台北植物園│從藝術之眼看臺灣生態之美特展','https://nmhmadenmh.kktix.cc/events/c2e263f6','國立歷史博物館與林業試驗所台北植物園的跨界合作，展出「臺灣名卉八品」與「臺灣動物八珍」系列畫作。','展覽','2020/10/14(三)','已結束','','2020/10/14(周三) 11:20(+0800)2020/10/25(周日) 16:30(+0800)'),(2,'『2020璀璨時光』-梁雪芳創作展','https://1289084.kktix.cc/events/904bfc4c-copy-10','自小生在大稻埕喜愛繪畫，發現愛畫畫的我，走過大稻程時光，追溯尋根，拾起老照片，結合當代版畫作品一一浮現往日時光。水彩畫的畫法及獨特情感表現，迷人筆觸特有色彩，寫生時將畫面感受於畫中，追求多樣的風華。','展覽','2020/9/28(一)','開賣中','','2020/09/28(周一) 08:00(+0800)2020/10/30(周五) 08:00(+0800)'),(3,'2020【轉機：台灣】年度攝影展 | 一場移工從東南亞到台灣的跨國旅程','https://oneforty.kktix.cc/events/turningpoint140-copy-1','關注移工的非營利組織 One-Forty 與台灣福興企業跨界合作，在高雄駁二舉辦 2020【轉機：台灣】年度攝影展，透過攝影作品及裝置藝術，以深刻內容帶來一場 70 萬移工從東南亞到台灣的跨國旅程。','展覽','2020/10/1(四)','檢視活動','','2020/10/01(周四) 12:00(+0800)2020/11/01(周日) 20:00(+0800)'),(4,'「生態標本創作展」','https://1289084.kktix.cc/events/904bfc4c-copy-11','動物標本是一門兼具生態、研究，與藝術的手藝，本次展覽將以鳥類標本為主，介紹如何透過標本延伸生命的意義，使環境教育更有意義。策展為未來環境生態顧問有限公司，是一間在2020年萌芽，由一群在各生態領域累積','展覽','2020/11/2(一)','開賣中','4人參加活動','2020/11/02(周一) 08:00(+0800)2020/11/27(周五) 17:00(+0800)'),(5,'BYUMS 2020 微創 / 斜槓顧家博覽會','https://byums.kktix.cc/events/byums20201107','微型商展 / 30秒商家簡介 / 交流研討 / 專題演講。宅經濟後疫情時期，活動提供參考、準備及學習。專題演講，邀請名人分享創業經驗：貝克街蛋糕創辦人＃王繁捷，百萬點閱網紅＃莫彩曦＆阿登。請把握機會～','展覽','2020/11/7(六)','開賣中','','2020/11/07(周六) 09:00(+0800)17:30(+0800)'),(6,'2020台灣國際咖啡展','https://chanchaotw.kktix.cc/events/asfsj0','本展將邁入第18年，已成為咖啡愛好者與從業人員獲取最新資訊的絕佳途徑。','展覽','2020/11/13(五)','開賣中','','2020/11/13(周五) 10:00(+0800)2020/11/16(周一) 18:00(+0800)'),(7,'2020台北國際酒展','https://chanchaotw.kktix.cc/events/r73eg3q0','透過在北、中、南四檔完整的巡迴酒展體系中，不僅協助客戶拓展全國市場，更結合產業資源串聯上中下游網絡”引領質感風潮”成為台灣最具影響力的專業酒類巡迴展會平台。','展覽','2020/11/13(五)','開賣中','','2020/11/13(周五) 10:00(+0800)2020/11/16(周一) 18:00(+0800)'),(8,'「斯土旅繪」-陳文明•水彩暨人體速寫個展','https://1289084.kktix.cc/events/904bfc4c-copy-12','繁華都市的台北、日日奔馳的汽車、湧動的人潮、比比相連的水泥高樓、喧囂動盪紊亂了我們的心靈。','展覽','2020/11/30(一)','7天後開賣','','2020/11/30(周一) 08:00(+0800)2020/12/30(周三) 08:00(+0800)'),(9,'VIVA Glamping 2020國際露營嘉年華','https://v